    def setlabel(self):
        text=self.box.currentText()
        if(text=="Easy"):
            word=random.choice(self.words)
            self.label_4.setText(word)
            self.label_4.setAlignment(QtCore.Qt.AlignCenter)
            self.words.remove(word)
        elif(text=="Medium"):
            word = random.choice(self.words1)
            self.label_4.setText(word)
            self.label_4.setAlignment(QtCore.Qt.AlignCenter)
            self.words1.remove(word)
        else:
            word = random.choice(self.words2)
            self.label_4.setText(word)
            self.label_4.setAlignment(QtCore.Qt.AlignCenter)
            self.words2.remove(word)


    def do_action(self):
        text=self.lineEdit.text()
        text1=self.label_4.text()
        if(text==text1):
            self.points=self.points+1
            self.score.setText(str(self.points))
            self.lineEdit.setText("")
            self.setlabel()
        else:
            self.lineEdit.setText("")
            self.setlabel()
